import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import ResidentName from '../ResidentName';
import DateOfBirth from '../ResidentDOB';
import ResidentRoom from '../ResidentRoom';
import Header from '../../../Header';

const ResidentName1 = ResidentName;
const DateOfBirth1 = DateOfBirth;

class CarePlan1 extends Component {
  render() {
    return (

        <div className="container" margin="10px">
            <Header/>
            <Container>
                <Row>
                    <Col>
                    <div>
                      <ResidentName1/>
                    </div>
                    </Col>
                    <Col>{DateOfBirth}</Col>
                </Row>

            </Container>
        </div>

    );
  }
}

export default CarePlan1;
